nodes:
    - type: backgroundImage
      backgroundImage: WorldMapUpscaled
    - type: music
      musicId: FirstSteps
    - type: speakers
      right:
          - Globox
      left:
          - Rayman
    - type: dialog
      speaker: Globox
      text:
          ja-JP: レイマンお‘元気‘げんき‘ですのう？
          en-US: How are you Rayman?
          he-IL: מה נשמע ריימן?
      audio:
          ja-JP: 252eac8ab0225
          en-US: 848763bedf0de
          he-IL: 083ea47511f08
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: いい‘天気‘てんき‘ですなーグロボクス
          en-US: I'm fine Globox thanks!
          he-IL: אצלי מעולה גלובוקס, תודה
      audio:
          ja-JP: 45e0861bb7495
          en-US: c21c8003e57bd
          he-IL: 3012d5d5247f6
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: じゃ、どこに‘行‘い‘くの？
          en-US: Well where are we going today?
          he-IL: אז לאיפה נלך היום?
      audio:
          ja-JP: af256b43e4705
          en-US: 94b9c7fd2dfeb
          he-IL: 4abdb7b4a6df4
    - type: dialog
      speaker: Globox
      text:
          ja-JP: まあな、どこやんけ…　ベティラさんの‘家‘いえ‘にやろう
          en-US: Um... Were are we going... I guess to Betilla's house
          he-IL: אממ לאן נלך היום... בוא נלך לבית של בטילה!
      audio:
          ja-JP: e8e8e0b093d42
          en-US: 844cc2b138fb7
          he-IL: b2cd0a6b9b458
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: もう、あのばばはもう‘旅‘たび‘に‘出発‘しゅっぱつ‘したかな
          en-US: I think that that old lady already went to a trip
          he-IL: נראה לי שהזקנה הזאת נסעה לטיול
      audio:
          ja-JP: d0a0b71dc07bc
          en-US: 6fb8b741333db
          he-IL: b536a3f9bbd14
    - type: dialog
      speaker: Globox
      text:
          ja-JP: そうやのう。‘出来‘でき‘まへんなあ。じゃ、タライザンに‘向‘む‘かえやんけ？
          en-US: Oh so we can't go there apparently. What about the Musician house?
          he-IL: נכון... אז אי אפשר ללכת לשם... אולי נלך למוזיקאי?
      audio:
          ja-JP: 76fa89ae139df
          en-US: 291844ff5fcaa
          he-IL: 0d14215744794
    - type: dialog
      speaker: Globox
      text:
          ja-JP: ‘決‘き‘めた。DREAM FORESTに‘今‘いま‘すぐ‘行‘い‘こう、レイマン
          en-US: I guess yes let's go to Blue Mountains right now!
          he-IL: החלטתי. בוא נלך עכשיו להרים הכחולים!
      audio:
          ja-JP: fd29bda0b5522
          en-US: de231a4e1045c
          he-IL: 0a9735da3c38a
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: ‘分‘わ‘かった。じゃ、‘行‘い‘こうグロボクス
          en-US: Understood. Let's go Globox!
          he-IL: הבנתי. קדימה בוא נלך גלובוקס
      audio:
          ja-JP: f9b86145db94c
          en-US: 77899caeee8e3
          he-IL: 6be91daaa55a8
    - type: speakers
    - type: backgroundImage
      backgroundImage: TheDreamForest_3
    - type: music
      musicId: AnimalLife
    - type: speakers
      right:
          - Rayman
          - Globox
      left:
          - Tarayzan
    - type: dialog
      speaker: Tarayzan
      text:
          ja-JP: よー‘皆様‘みなさま‘！お‘久‘ひさ‘しぶりですね！
          en-US: Hi Buddies! Long time no see!
          he-IL: היי חברים! הרבה זמן לא נפגשנו!
      audio:
          ja-JP: 89b04eedfd97b
          en-US: eb7e32daf2834
          he-IL: 52f233cceaf9
    - type: dialog
      speaker: Rayman
      text:
          ja-JP: ‘久‘ひさ‘しぶり‘久‘ひさ‘しぶり！
          en-US: Tarayzan! I'm so happy to see you!
          he-IL: טרייזן! טוב לראות אותך!
      audio:
          ja-JP: 7c1eb3aae54b3
          en-US: 136b9ed428744
          he-IL: 136c563ee3e28

